import React from "react";
import me_pic from "../../images/me.jpg";

const about = () => {
  console.log("Here in about");
  return (
    <div className="About">
      About
      <img src={me_pic} height="500px" width="500px" alt="me_pic" />
    </div>
  );
};

export default about;
